	},
	[110] = {
		Title = "Diretor da Academia Criatura",
		Description = {
			"Encontre e fale com o diretor da Academia Criatura"
		}
	},
	[1000] = {
		Title = "Renascimento",
		Description = {
			"Encontre o Hall das Valquírias através do Livro de Ymir. Lá, você poderá provar seu heroísmo."
		},
		Summary = "Ao Hall das Valquírias"
	},
	[1001] = {
		Title = "Mudança de Classe: Noviço",
		Description = {
			"Falou com o Padre Mareusis para se tornar um Noviço. Ele ordenou que você visitasse ^000077Padre Rubalkabara^000000, que tem praticado ascetismo perto das Relíquias, a nordeste da cidade de Prontera."
		},
		Summary = "Fale com o Padre Rubalkabara."
	},
	[1002] = {
		Title = "Mudança de Classe: Noviço",
		Description = {
			"Falou com o Padre Mareusis para se tornar um Acólito. Ele ordenou que você visitasse ^000077Mãe Mathilda^000000, que tem praticado ascetismo perto da cidade de Morroc, localizada a sudoeste da cidade de Prontera."
		},
		Summary = "Fale com a Mãe Mathilda"
	},
	[1003] = {
		Title = "Mudança de Classe: Noviço",
		Description = {
			"Falou com o Padre Mareusis para se tornar um Noviço. Ele ordenou que você visitasse o ^000077Padre Yosuke^000000, que tem praticado ascetismo perto de uma ponte, localizada a noroeste de Prontera."
		},
		Summary = "Fale com o Padre Yosuke"
	},
	[1004] = {
		Title = "Mudança de Classe: Arqueiro",
		Description = {
			"Para se tornar um Arqueiro, você deve receber uma nota de pelo menos ^0000FF25^000000 pontos de 40. Você pode obter Troncos dos monstros \"Willow\". Mas tenha cuidado. Eles podem ser monstros difíceis."
		},
		Summary = "Pegue Trunks e apresente-se ao Membro da Guilda dos Arqueiros."
	},
	[1005] = {
		Title = "Mudança de Classe: Mago",
		Description = {
			"O Mago da Guilda ordenou que você fizesse uma mistura Solução no. 1 para se tornar um Mago. Você pode procurar os ingredientes necessários para fazer a solução no Guide Book desta guilda."
		},
		Summary = "Solução no. 1"
	},
	[1006] = {
		Title = "Mudança de Classe: Mago",
		Description = {
			"O Mago da Guilda ordenou que você fizesse uma mistura Solução no. 2 para se tornar um Mage. Você pode procurar os ingredientes necessários para fazer a solução no Guide Book desta guilda."
		},
		Summary = "Solução no. 2"
	},
	[1007] = {
		Title = "Mudança de Classe: Mago",
		Description = {
			"O Mago da Guilda ordenou que você fizesse uma mistura Solução No.3 para se tornar um Mage. Você pode procurar os ingredientes necessários para fazer a solução no Guide Book desta guilda."
		},
		Summary = "Solução no. 3"
	},
	[1008] = {
		Title = "Mudança de Classe: Mago",
		Description = {
			"O Mago da Guilda ordenou que você fizesse uma mistura Solução No.4 para se tornar um Mage. Você pode procurar os ingredientes necessários para fazer a solução no Guide Book desta guilda."
		},
		Summary = "Solução no. 4"
	},
	[1009] = {
		Title = "Mudança de Classe: Mercador",
		Description = {
			"Pegue o pacote de entrega no armazém e vá até a antiga Guilda dos Espadachins em Prontera. Quando você chegar lá, visite a funcionária da Kafra que está lá. O nome dela é Blossom."
		},
		Summary = "Entregue o produto em Prontera."
	},
	[1010] = {
		Title = "Mudança de Classe: Mercador",
		Description = {
			"Pegue o pacote de entrega no armazém e vá para a Guilda dos Magos em Geffen. Quando chegar lá, visite o responsável da Guilda dos Magos"
		},
		Summary = "Entregar o pacote à Guilda dos Magos em Geffen"
	},
	[1011] = {
		Title = "Mudança de Classe: Mercador",
		Description = {
			"Pegue o pacote de entrega no armazém e depois vá para Morroc. Lá você deve encontrar Java Dullihan, o tintureiro. Ele é um pouco esquecido, portanto, é melhor entregar o pacote a um de seus alunos."
		},
		Summary = "Entregar o pacote ao Tintureiro em Morroc."
	},
	[1012] = {
		Title = "Mudança de Classe: Mercador",
		Description = {
			"Pegue o pacote de entrega no armazém e entregue-o ao funcionário da Kafra que está na ilha Byalan."
		},
		Summary = "Entregue o produto e a mensagem à Funcionária Kafra da Ilha Byalan."
	},
	[1013] = {
		Title = "Mudança de Classe: Gatuno",
		Description = {
			"Roube os cogumelos da fazenda de Shibu. Colete 2 tipos de cogumelos: ^0000FFOrange Net Mushroom^000000 3 pontos e ^0000FFOrange Gooey Mushroom^000000 1 ponto. Você precisa de um total de 25 pontos para passar no teste. Siga em direção ao Eastern Field of the Pyramids (Campo Leste das Pirâmides)."
		},
		Summary = "Colha cogumelos líquidos de laranja e cogumelos pegajosos de laranja"
	},
	[1014] = {
		Title = "Mudança de Classe: Espadachim",
		Description = {
			"O objetivo desse teste é confirmar se você está ou não qualificado para ser um Espadachim. Agora, as condições para concluir esse teste são muito simples. Você percorrerá três percursos e deverá chegar ao ponto de controle final em ^FF000010 minutos^000000."
		},
		Summary = "Passe em todas as etapas do teste."
	},
	[1015] = {
		Title = "Sua primeira missão",
		Description = {
			"Você recebeu um Bao. É um pão saboroso que os acadêmicos orientais tradicionalmente comem antes de estudar. Recentemente, esses estudiosos descobriram que um estômago cheio de Bao é a soma de toda a lógica."
		},
		Summary = "Fale com o Guia de missões Tutor Cícero e verifique se você ainda tem o Bao."
	},
	[1016] = {
		Title = "Ganho níveis de base",
		Description = {
			"Ganhe 2 níveis de base para completar seu Treinamento de Combate de Campo matando o máximo de monstros que puder. Certifique-se de falar com a equipe no Norte depois de aumentar seu nível de base em 2."
		}
	},
