			"A contínua reprodução das Centopeias é outro problema principalmente com seu apetite voraz. Eles comem todo o Bradium e destroem as entradas das minas. Muitos dos nossos amigos Manuk perderam suas vidas para as Centopeias. Por favor, extermine-as."
