			"Os mineradores do centro da Caverna do Nidhogg reportaram que foram atacados por uma 'coisa' muito estranha. Eles apenas disseram que pareciam humanos de água, mas eram muito más para serem apenas água. Entretanto eles são originários da Caverna de Nidhogg, vá dar uma olhada."
