	[19116] = {
		Title = "O olho de Hellion",
		Description = {
			"Você encontrou um tonel com uma mensagem: \"O que será? Vinho ou suco de uva? Ah, mas eu prefiro vinho\". Informe Grout'he sobre a mensagem."
		}
	},
	[19117] = {
		Title = "O olho de Hellion",
		Description = {
			"Você encontrou uma mensagem de Tyus, retorne a Grout'he e diga a ele o que encontrou sob o Wooden Floor."
		}
	},
	[19118] = {
		Title = "O olho de Hellion",
		Description = {
			"Você disse a Grout'he o que dizia a laje sob o piso de madeira. Ele lhe disse para verificar a enorme estátua de pedra na Archer Village, ao norte."
		}
	},
	[19119] = {
		Title = "O olho de Hellion",
		Description = {
			"Você obteve uma tábua de Payon da estátua de Buda. Você deve levá-la de volta a Chilias'Tyus em Morroc."
		}
	},
	[19120] = {
		Title = "O olho de Hellion",
		Description = {
			"Você recebeu um Morroc Tablet. Chilias'Tyus diz que você deve viajar para Geffen e encontrar um homem chamado Welshyun."
		}
	},
	[19121] = {
		Title = "O olho de Hellion",
		Description = {
			"Welshyun pediu que você encontrasse seu aluno Enoz na torre de Geffen. Certifique-se de que ele tenha o relatório chamado \"A vida dos monstros na área de Geffen\"."
		}
	},
	[19122] = {
		Title = "O olho de Hellion",
		Description = {
			"Seu insulto pode não ter sido uma ideia tão boa. Tente fazer as pazes com Welshyun."
		}
	},
	[19123] = {
		Title = "O olho de Hellion",
		Description = {
			"Welshyun diz que está com sede. Traga uma poção para ele e veja se consegue fechar sua garganta."
		}
	},
	[19124] = {
		Title = "O olho de Hellion",
		Description = {
			"Parece que Enoz perdeu o livro Vida de Monstro. Volte para Welshyun e avise-o."
		}
	},
	[19125] = {
		Title = "O olho de Hellion",
		Description = {
			"Welshyun diz que você deve entregar o livro a Enoz na Torre de Geffen e trazer 1 Blue Gemstone quando voltar."
		}
	},
	[19126] = {
		Title = "O olho de Hellion",
		Description = {
			"Volte para Welshyun e não se esqueça de trazer 1 Blue Gemstone. Se ele lhe fizer uma pergunta estranha, responda \"Valaskjalf"
		}
	},
	[19127] = {
		Title = "O olho de Hellion",
		Description = {
			"Você recebeu uma tábua de Geffen. Leve todos os tabletes de volta a Sir Chilias'Tyus em Morroc."
		}
	},
	[19128] = {
		Title = "O olho de Hellion",
		Description = {
			"Chilias'Tyus diz que Welshyun é o único que pode combinar as peças do tablet em sua forma completa."
		}
	},
	[19129] = {
		Title = "O olho de Hellion",
		Description = {
			"Você tem o Tablet concluído. Leve-a a Chilias'Tyus para que ele saiba que a tarefa foi concluída."
		}
	},
	[19200] = {
		Title = "RPS com Troy",
		Description = {
			"Você só pode desafiar Troy depois que o cronômetro expirar."
		}
	},
	[21001] = {
		Title = "Primeiros Passos",
		Description = {
			"Você estava viajando em um navio que naufragou em uma ilha deserta devido a uma tempestade. Informe ao capitão que ainda há pessoas feridas a bordo."
		},
		Summary = "Saia e fale com o Capitão"
	},
	[21002] = {
		Title = "Primeiros Passos",
		Description = {
			"Entregue 2 Madeiras de Reparos para o Marinheiro. Para conseguir a Madeira de Reparos, basta clicar em um Alvo de Prática para atacar, quando o monstro for morto, a Madeira de Reparos irá direto para o seu inventário."
		},
		Summary = "2 Madeiras de Reparo"
	},
	[21003] = {
		Title = "Algo para enjoo de movimento",
		Description = {
			"Decidi levar ao meu amigo Leno, que conheci durante a viagem, algo para beber para aliviar seu enjoo. Vamos perguntar ao ^4d4dffcurandeiro^000000 do ^4d4dffAcademia Criatura healing center^000000 sobre medicina herbal."
		},
		Summary = "Faça uma pergunta sobre herbalismo ao curandeiro"
	},
	[21004] = {
		Title = "Herbalismo básico",
		Description = {
			"O curandeiro quer que você encontre a erva vermelha para a poção. Vamos encontrar a ^4d4dffRed Grass^000000 do lado de fora do portão principal de Criatura."
		},
		Summary = "Encontre a grama vermelha do lado de fora da entrada principal"
	},
	[21005] = {
		Title = "Salve o local!",
		Description = {
			"Eu tenho uma boa."
		},
		Summary = ""
	},
	[21006] = {
		Title = "Boas notícias para Leno",
		Description = {
			"Acho que você pode dizer ao Leno o que recebeu do terapeuta."
		},
		Summary = "Fale com Leno"
	},
	[21007] = {
		Title = "Primeira vez que encontro um amigo",
		Description = {
			"Conheci um bom amigo."
