	},
	[60724] = {
		Title = "Selo de Megingjard",
		Description = {
			"O bibliotecário Jekan parece estar ocupado, talvez eu deva apenas \"ler alguns documentos\" por um tempo e depois verificar nas prateleiras até que ele descubra onde devo verificar nas prateleiras os \"Registros do 3º Pelotão\"."
		}
	},
	[60725] = {
		Title = "Selo de Megingjard",
		Description = {
			"Jekan precisará de alguns itens para fazer uma cópia dos registros. 2 Slick Paper e 1 Oil Paper de Amatsu, 3 Feather of Birds de Morroc e 20 Blue Gems de Geffen."
		},
		Summary = "Leve esses itens para Jekan para que ele termine a cópia mais rapidamente."
	},
	[60726] = {
		Title = "Selo de Megingjard",
		Description = {
			"Sua cópia dos registros tem uma mágica de pesquisa estranha. Para encontrar informações específicas, você precisa primeiro verificar o tópico amplo e depois ser mais específico: crusader 3rd_company 3rd_platoon 1st_squad."
		},
		Summary = "Pesquise os nomes dos membros individuais para saber onde eles estão atualmente."
	},
	[60727] = {
		Title = "Selo de Megingjard",
		Description = {
			"Encontre Zan Huadoku dentro da guilda Geffen Blacksmith. Seja educado ao perguntar a ele como está indo antes de entrar em contato para perguntar sobre a missão final ultrassecreta. Sim, esse é o ingresso!"
		}
	},
	[60728] = {
		Title = "Selo de Megingjard",
		Description = {
			"Zan Huadoku lhe disse tudo o que você acha que é possível. Você deve ir a Morroc para encontrar \"Cuaque Donon\", que foi visto pela última vez na pousada. Você tem a sensação de que talvez precise ser teimoso em Morroc."
		}
	},
	[60729] = {
		Title = "Selo de Megingjard",
		Description = {
			"Cuaque Donon está em um esconderijo da Rogue Guild, provavelmente em \"Fortress Saint Darmain (South)\" [use o mapa ctrl + ~] A senha para entrar deve ser \"Aragham never hoarded upgrade items\"."
		},
		Summary = "O Cuaque está sofrendo de TEPT extremo e \"surta\", então fingir que ele é uma criança pequena ajudaria, talvez até mesmo uma boneca hahaha."
	},
	[60730] = {
		Title = "Selo de Megingjard",
		Description = {
			"Cuaque disse que a equipe encontrou o \"Megingjard\" e começou uma discussão... Você precisa saber mais sobre essa discussão, talvez Jack.O em Alberta, nas docas, possa ajudar."
		},
		Summary = "Ele ainda é um cruzado ativo, portanto, acho que falar com ele será muito mais simples."
	},
	[60731] = {
		Title = "Selo de Megingjard",
		Description = {
			"Jack.O encontrou algum alívio com as \"ervas verdes\". Talvez eu deva passar esse conselho para os outros cruzados que encontrar. Emma Searth está em Al De Baran, um barco rápido para Izlude e uma dobra de Kafra para Al De Baran me levarão até lá em um instante!"
		},
		Summary = "Talvez eu também deva pensar em um auxílio de memória para esses cruzados, algo que os ajude a se lembrarem de seu lugar, como um \"Bookclip\" de uma \"Rideword"
	},
	[60732] = {
		Title = "Selo de Megingjard",
		Description = {
			"Acho que preciso me apressar para ver \"The Nineball\", que trabalha como segurança na pousada Jawaii. Ouvi dizer que há um ex-barman de Jawaii trabalhando no Central Prontera Pub, talvez ele saiba uma maneira de chegar a Jawaii sem dar o nó!"
		},
		Summary = "Alguém chamado Nineball e que é segurança provavelmente é um tipo de pessoa de boca fechada, eu deveria continuar falando até que ele pelo menos reaja às minhas perguntas..."
	},
	[60733] = {
		Title = "Selo de Megingjard",
		Description = {
			"Saia de Jawaii com um Butterflywing ou beba de volta para Rune-Midgarts. Vá para Comodo para ver \"Royal Myst\" no cassino sul. Morroc para Comodo é geralmente a maneira mais fácil de se deslocar para Comodo."
		},
		Summary = "Um \"par\" de doses de \"álcool\" pode soltar a língua do Royal Myst..."
	},
	[60734] = {
		Title = "Selo de Megingjard",
		Description = {
			"Você falou com todos os cruzados que ainda estão vivos. Aparentemente, algo aconteceu, a culpa foi transferida e o cruzado Egnigem morreu no processo. Você deve retornar ao Castelo de Prontera e informá-lo de suas descobertas."
		},
		Summary = "Um salto de kafra de Comodo para Morroc para Prontera é rápido, a menos que você seja salvo em Prontera."
	},
	[60735] = {
		Title = "Selo de Megingjard",
		Description = {
			"Você deve falar com o último membro do 1º esquadrão, o falecido Egnigem. Um salto de Kafra de Prontera para Morroc, Comodo, Umbala e, em seguida, uma viagem para o norte até a Árvore da Vida e Nifflheim pode levá-lo até ele."
		},
		Summary = "Ouça o Egnigem e veja o que você pode fazer para corrigir isso."
	},
	[60736] = {
		Title = "Selo de Megingjard",
		Description = {
			"Pela misericórdia de Odin, isso é terrível. Você nunca acreditou que um santo Cruzado faria um ato tão maligno para reivindicar o poder de Megingjard. Seja corajoso e retorne à sede da Cruzada e conte a Max Von Shedough o que você sabe."
		}
	},
	[60737] = {
		Title = "Selo de Megingjard",
		Description = {
			"Max Von Shedough aceitou meu relatório e está profundamente preocupado com seu conteúdo, mas parte de mim realmente acredita que, apesar das boas intenções, a realidade política pode intervir para impedir que a justiça seja feita."
		},
		Summary = "Devo contar a Egnigem pelo menos o resultado, ele merece pelo menos saber pelo que morreu."
	},
	[60738] = {
		Title = "Selo de Megingjard",
		Description = {
			"Egnigem o abençoou com toda a força que lhe resta. Você tem a sensação de que há uma pessoa especial que ele gostaria que conhecesse seu destino. Você deve contar a Emma Searth sobre o destino dele."
		}
	},
	[60739] = {
		Title = "Selo de Megingjard",
		Description = {
			"Emma não consegue se lembrar, mas pode sentir a perda. Sua fé na Justiça está fraca agora... Você deve dizer a Max Von Shedough que ele é o juiz e que deve compartilhar esse fardo de culpa."
		},
		Summary = "Retorne a Max Von Shedough no Castelo de Prontera."
	},
	[60801] = {
		Title = "WoE Criador de animais de estimação",
		Description = {
