	[60810] = {
		Title = "Acesso VIP limitado",
		Description = {
			"Por 3 dias, isso permite que você use os serviços com desconto dos Funcionários da Kafra, Primo d'Buffer, warps do Serviço VIP, missões e warps do Gramps get 2 hunt. Quando o tempo expirar, você não poderá obter acesso."
		},
		Summary = "*Observe que os bônus de EXP VIP, slots de personagens extras e 600 de armazenamento não estão incluídos neste acesso."
	},
