	[63582] = {
		Title = "Episódio Ragnarok",
		Description = {
			"O Padre Huntington, da Igreja de Prontera, está procurando aventureiros para uma expedição. Fale com ele para participar."
		},
		Summary = "Junte-se à equipe da Expedition."
	},
	[63583] = {
		Title = "Episódio Ragnarok",
		Description = {
			"O Padre Huntington quer que eu me apresente à Paladina Liefa. Posso vê-la atrás do Padre Huntington dentro do Santuário."
		},
		Summary = "Fale com Liefa."
	},
	[63584] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Devo preparar minhas coisas e depois falar com Liefa novamente dentro do Santuário para embarcarmos em nossa expedição."
		},
		Summary = "Diga a Liefa que você está pronto."
	},
	[63585] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Liefa quer me apresentar ao capitão Muwuse e seu irmão Mowose, que nos levarão até a fronteira em seu dirigível."
		},
		Summary = "Encontre Muwuse no aeroporto de Izlude."
	},
	[63586] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Junte-se à tripulação e embarque no dirigível chamado \"The Rudolph's Quest\"."
		},
		Summary = "Entre no dirigível do Muwuse."
	},
	[63587] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Eu deveria conhecer Muwuse e falar com ele enquanto estiver a bordo de seu dirigível. Parece que ele conhece a Liefa e o Lief há muito tempo. Eu deveria perguntar a ele sobre todos a bordo."
		},
		Summary = "Fale com Muwuse."
	},
	[63588] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Falei com o Muwuse sobre a Liefa, devo perguntar a ele sobre os outros também."
		},
		Summary = "Pergunte a Muwuse sobre todos."
	},
	[63589] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Falei com Muwuse sobre Lief, devo perguntar a ele sobre os outros também."
		},
		Summary = "Pergunte a Muwuse sobre todos."
	},
	[63590] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Falei com Muwuse sobre ele mesmo, deveria perguntar sobre os outros também."
		},
		Summary = "Pergunte a Muwuse sobre todos."
	},
	[63591] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Conversei com Muwuse sobre Mowose, e deveria perguntar a ele sobre os outros também."
		},
		Summary = "Pergunte a Muwuse sobre todos."
	},
	[63592] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Falei com Muwuse sobre todos, eu deveria conhecer pessoalmente o restante da equipe de expedição."
		},
		Summary = "Fale com todos."
	},
	[63593] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Falei com Mowose, irmão de Muwuse. Se eu precisar de um refresco, devo ir até ele mais tarde."
		},
		Summary = "Fale com todos."
	},
	[63594] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Falei com Liefa, ela é a líder da expedição e parece ser simpática."
		},
		Summary = "Fale com todos."
	},
	[63595] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Falei com Lief, o irmão de Liefa. Parece que todos nessa aeronave estão trabalhando juntos há muito tempo."
