		Summary = "Fale com Liefa."
	},
	[63599] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Parece que vamos nos separar e viajar para Tapte Stjerner separadamente. Era a principal vila de assentamento, ao norte da zona de pouso. Há um ponto de encontro próximo ao centro da cidade onde devemos nos encontrar."
		},
		Summary = "Siga para o norte até Tapte Stjerner."
	},
	[63600] = {
		Title = "Episódio Ragnarok",
		Description = {
			"Precisamos investigar o que aconteceu aqui. Provavelmente aprenderei mais estudando os restos mortais dos aldeões. Preciso encontrar 4 dos restos mortais dos aldeões na cidade e depois me encontrar com os outros no ponto de encontro."
